import React from "react";
import { Container, Content, Options } from "./styles";


export function Header(){
    return(
        <Container>
            <Content>
                <a type="button" href="">
                    <h1>Napkins</h1>
                </a>

                <Options>
                    <a>Our Story</a>
                    <a>Meet the Team</a>
                    <a>Issues</a>
                    <a id="bold">Submit</a>
                </Options>

            </Content>
        </Container>
    )
}
